      "get": {
        "operationId": "ListCachePolicies2020_05_31",
        "description": "<p>Gets a list of cache policies.</p> <p>You can optionally apply a filter to return only the managed policies created by AWS, or only the custom policies created in your AWS account.</p> <p>You can optionally specify the maximum number of items to receive in the response. If the total number of items in the list exceeds the maximum that you specify, or the default maximum, the response is paginated. To get the next page of items, send a subsequent request that specifies the <code>NextMarker</code> value from the current response as the <code>Marker</code> value in the subsequent request.</p>",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "text/xml": {
                "schema": {
                  "$ref": "#/components/schemas/ListCachePoliciesResult"
                }
              }
            }
          },
          "480": {
            "description": "AccessDenied",
            "content": {
              "text/xml": {
                "schema": { "$ref": "#/components/schemas/AccessDenied" }
              }
            }
          },
          "481": {
            "description": "NoSuchCachePolicy",
            "content": {
              "text/xml": {
                "schema": { "$ref": "#/components/schemas/NoSuchCachePolicy" }
              }
            }
          },
          "482": {
            "description": "InvalidArgument",
            "content": {
              "text/xml": {
                "schema": { "$ref": "#/components/schemas/InvalidArgument" }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "Type",
            "in": "query",
            "required": false,
            "description": "<p>A filter to return only the specified kinds of cache policies. Valid values are:</p> <ul> <li> <p> <code>managed</code> – Returns only the managed policies created by AWS.</p> </li> <li> <p> <code>custom</code> – Returns only the custom policies created in your AWS account.</p> </li> </ul>",
            "schema": { "type": "string", "enum": ["managed", "custom"] }
          },
          {
            "name": "Marker",
            "in": "query",
            "required": false,
            "description": "Use this field when paginating results to indicate where to begin in your list of cache policies. The response includes cache policies in the list that occur after the marker. To get the next page of the list, set this field’s value to the value of <code>NextMarker</code> from the current page’s response.",
            "schema": { "type": "string" }
          },
          {
            "name": "MaxItems",
            "in": "query",
            "required": false,
            "description": "The maximum number of cache policies that you want in the response.",
            "schema": { "type": "string" }
          }
        ],
        "summary": "List Cache Policies"
      }
    },
    "/2020-05-31/origin-access-identity/cloudfront": {
      "post": {
        "operationId": "CreateCloudFrontOriginAccessIdentity2020_05_31",
        "description": "Creates a new origin access identity. If you're using Amazon S3 for your origin, you can use an origin access identity to require users to access your content using a CloudFront URL instead of the Amazon S3 URL. For more information about how to use origin access identities, see <a href=\"https://docs.aws.amazon.com/AmazonCloudFront/latest/DeveloperGuide/PrivateContent.html\">Serving Private Content through CloudFront</a> in the <i>Amazon CloudFront Developer Guide</i>.",
